import { Nav } from "react-bootstrap";
import { Link } from "react-router-dom";

const NavBar = () => {
  return (
    <Nav variant="pills" defaultActiveKey="/">
      <Nav.Item>
        <Link to="/">HOME </Link>
      </Nav.Item>
      <Nav.Item>
        <Link to="/about" eventKey="link-1">
          ABOUT
        </Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link eventKey="disabled" disabled>
          Disabled
        </Nav.Link>
      </Nav.Item>
    </Nav>
  );
};
export default NavBar;
